using System.Collections.Generic;
using Microsoft.AspNetCore.Identity;

namespace SWARocketChat.Models
{
    // Add profile data for application users by adding properties to the ApplicationUser class
    public class ApplicationUser : IdentityUser
    {
        public ApplicationUser()
        {
            {
                UserRoomList = new HashSet<UserRoomList>();
            }
        }
        public string UserImage { get; set; } =" data:image/png;base64,";
        public byte Status { get; set; }
        //public ChatroomMembers ChatroomMembers { get; set; }
        public ICollection<UserChatroomMember> UserChatroomMembers { get; set; } = new List<UserChatroomMember>();
        public ICollection<UserRoomList> UserRoomList { get; set; }
    }
}
